import React from 'react'
import {
    MDBContainer,
    MDBRow,
    MDBCard,
    MDBCol,
    MDBCardBody,
    MDBTabs,
    MDBTabsItem,
    MDBTabsLink,
    MDBTabsPane,
    MDBTabsContent,
    MDBIcon,
    MDBCheckbox,
    MDBInput,
    MDBBtn,
  } from "mdb-react-ui-kit";

const Login = () => {
   
        const [fillActive, setFillActive] = useState("tab-login");
      
        const handleFillClick = (value) => {
          if (value === fillActive) {
            return;
          }
      
          setFillActive(value);
        };
      
  return (
    <div>Login</div>
  )
}

export default Login
